import React,{useState } from "react"
import ReactDOM from 'react-dom/client';
import Navbar from "./nav";
import Products from "./products"
import axios from "axios"
function App(){
  const [iscartOpen,setCartopen]=useState(false);
  const [responseMessage, setResponseMessage] = useState('');
  function openCart(){
    setCartopen(true);
  };
  function closecart(){
    setCartopen(false);
  }
  const handleButtonClick = async () => {
    console.log("button clicked")
    try {
      const response = await axios.get('http://localhost:3001/sell'); // Use Axios to send a GET request
      if (response.status === 200) {
        window.location.href = "http://localhost:3001/sell";
      } else {
        console.error('Request failed.');
      }
    } catch (error) {
      console.error(error);
    }
  };
  // const handleButtonClick = () => {
  //   console.log("Button clicked");
  //   window.location.href = 'http://localhost:3001/sell';
  // };
    return (     
    <div>

    <Navbar />
    <div className="heading">
    <div className="desc">
      <h1 className="ename">
        CLICKS
      </h1>
      <p className="para">
        A ecommerce platform who wants to capture events and memories. We ensure Quality captures
      </p>
      
      <div className="buttons">
        <button className="shop">SHOP NOW</button>

        <button className="sell" onClick={handleButtonClick}>SELL ITEM</button>

        
      </div>

    </div>
    <div><img className="headimg" src="./images/camheadnoback.png"/></div>
    
  </div>
  <Products />
  </div>
    )
    
}
export default App;
